const Home = () => {
  const handleClick = () => {
    console.log("Hey there!");
  };

  const handleClickAgain = (name) => {
    console.log("Hey " + name + "!");
  };

  return (
    <div className="Home">
      <h2>Homepage</h2>
      <button onClick={handleClick}>Click me</button>
      <button
        onClick={() => {
          handleClickAgain("Tobi");
        }}
      >
        Click me again
      </button>
      {
        // Comments in JSX need to be in curly braces
        //the arrow function (anonymus) only fires after a click and invokes the
        //handle click again function as well as passes down the argument
      }
    </div>
  );
};

export default Home;
